export default function HomePage() {
    const result = async () => {
        try {
            const data = await fetch('http://localhost:9000')
            console.log(data.text())
            return data
        } catch (err) {
            console.error('Error fetching at PORT-9000: ',err)
        }
    }

    console.log(result)

    return(
        <div>
            `${result}`
        </div>
    )
}
